import DeveloperList from "../components/DeveloperList";

const DEVELOPER_QUERY = gql`
    {
      getAllDevelopers {
        id
        name
        surname
        userEmail
        games {
        id
          title
          description
          imageURL
          genres{
            name
          }
        }
      }
    }
    `



export default function DevelopersPage()
{
    const developers=data.getAllDevelopers

    return <DeveloperList developers={developers}/>

}

export async function loader()
{
    const { data, loading, error } = await useQuery(DEVELOPER_QUERY);

    if (loading) return <p className="text-center text-gray-600">Loading developers...</p>;
    if (error) return <p className="text-center text-red-500">Error loading data</p>;

    return data
}
